import './ProfileInfo.module.css';
import ava from './ava.jfif'

const ProfileInfo = () => {
    return (
        <div className='ProfileInfo'>
            <img src={ava} alt="Avatar" />
            <div className="info">
                <h1>Profile</h1>
                <p>Name: Andriy</p>
                <p>Age: 95</p>
            </div>
        </div>
    );
}

export default ProfileInfo;
